      <HamburgerIcon boxSize={30} />
      <div className={styles.mobile_navbar}>
        <CloseIcon color="black" />
        <nav>
          <a href="">Главная</a>
          <a href="">О нас</a>
          <a href="">Комнаты</a>
          <a href="">Новости</a>
          <a href="">Контакты</a>
        </nav>
      </div>
    </div>
  );
};
